# This code produce a query code for SQL
#The output query should be run on TF_Nfifty_tables_and_two_200Col_tables.db
##################################################################################################################################
def main():
    query = "CREATE TABLE Terms_Frequency_200col_2 AS\n"
    tech_ID_list = [4, 5, 6, 7]
    for idx in tech_ID_list:
        sel = f"SELECT Terms_Frequency_{idx}.Term"
        lef = ""
        isNull = ""

        for idx2 in tech_ID_list:
            IDSET = []
            for i in range(idx2 * 50, (idx2 + 1) * 50):
                IDSET.append(i)
            if idx2== tech_ID_list[0]:
                IDSET.remove(220)
            if idx2 == tech_ID_list[2]:
                IDSET.remove(306)
            if idx2 == tech_ID_list[3]:
                IDSET.remove(386)

            for id in IDSET:
                sel = sel + f", Terms_Frequency_{idx2}.FreqTech_{id}"
        sel = sel + f" FROM Terms_Frequency_{idx}\n"

        lef_list = [x for x in tech_ID_list if x != idx]
        for idx2 in lef_list:
            lef = lef + f"LEFT JOIN Terms_Frequency_{idx2} ON Terms_Frequency_{idx}.Term = Terms_Frequency_{idx2}.Term\n"
        
        if idx > tech_ID_list[0]:
            isNull = "WHERE "
        for idx2 in range(tech_ID_list[0], idx):
            IDSET = []
            for i in range(idx2 * 50, (idx2 + 1) * 50):
                IDSET.append(i)
            if idx2== tech_ID_list[0]:
                IDSET.remove(220)
            if idx2 == tech_ID_list[2]:
                IDSET.remove(306)
            if idx2 == tech_ID_list[3]:
                IDSET.remove(386)

            for id in IDSET:
                isNull = isNull + f"Terms_Frequency_{idx2}.FreqTech_{id} IS NULL AND "    
        isNull = isNull[:-5]           
        if idx > tech_ID_list[0]:
            isNull = isNull + "\n"

        query = query + sel + lef + isNull
        if idx < tech_ID_list[3]:
            query = query + "UNION\n"

    print(query)
    

    #print("isnull:", isNull)
##################################################################################################################################
if __name__ == '__main__':
    main()

